        @supports (color: rgb(0 0 0/0)) {
            :root {
                --color-ten: #cfd2d5;
            }
        }

        * {
            border: none;
            margin: 0px;
            outline: 0px;
            padding: 0px;
        }

        body {
            color: var(--text-color);
            font-family: var(--font-family-Poppins);
            font-size: 14px;
            font-weight: 400;
            line-height: 1.6em;
        }

        .bordered-layout .page-wrapper {
            padding: 0px 50px;
        }

        a {
            color: var(--main-color);
            cursor: pointer;
            position: relative;
            text-decoration: none;
            transition: all 0.3s ease 0s;
        }

        a:focus, a:hover, a:visited, button {
            text-decoration: none;
            outline: 0px !important;
        }

        h1, h2, h3, h4, h5, h6 {
            background: 0px 0px;
            color: var(--white-color);
            margin: 0px;
            position: relative;
        }

        .transition-300ms {
            transition: all 0.3s ease 0s;
        }

        .transition-500ms {
            transition: all 0.5s ease 0s;
        }

        .transition-900ms {
            transition: all 0.9s ease 0s;
        }

        textarea {
            overflow: hidden;
        }

        .text, p {
            color: var(--text-color);
            font-size: var(--font-16);
            line-height: 1.8em;
            opacity: 0.7;
            position: relative;
        }

        h1 {
            font-size: var(--font-70);
            line-height: 1em;
        }

        h1, h2 {
            font-weight: 600;
        }

        h2 {
            font-size: var(--font-45);
            line-height: 1.2em;
        }

        h3 {
            font-size: var(--font-30);
            line-height: 1.3em;
        }

        h3, h4 {
            font-weight: 700;
        }

        h4 {
            font-size: var(--font-24);
        }

        h4, h5 {
            line-height: 1.4em;
        }

        h5 {
            font-size: var(--font-20);
        }

        h5, h6 {
            font-weight: 600;
        }

        h6 {
            font-size: var(--font-18);
            line-height: 1.6em;
        }

        .auto-container {
            max-width: 1240px;
        }

        .auto-container, .medium-container {
            margin: 0px auto;
            padding: 0px 15px;
            position: static;
        }

        .medium-container {
            max-width: 1000px;
        }

        .page-wrapper {
            margin: 0px auto;
            min-width: 300px;
            position: relative;
            width: 100%;
        }

        li, ul {
            list-style: none;
            margin: 0px;
            padding: 0px;
        }

        .theme-btn {
            cursor: pointer;
            display: inline-block;
            transition: all 0.3s ease 0s;
        }

        .centered {
            text-align: center;
        }

        ::-webkit-input-placeholder {
            color: inherit;
        }

        .scroll-to-top {
            background: var(--white-color);
            border-radius: 50%;
            bottom: 15px;
            box-shadow: rgba(0, 0, 0, 0.15) 0px 0px 10px;
            color: var(--main-color);
            cursor: pointer;
            display: none;
            font-size: var(--font-16);
            height: 40px;
            line-height: 38px;
            position: fixed;
            right: 15px;
            text-align: center;
            text-transform: uppercase;
            transition: all 0.3s ease 0s;
            width: 40px;
            z-index: 100;
        }

        .scroll-to-top:hover {
            background: var(--main-color);
            color: var(--white-color);
        }

        .list-style-one {
            position: relative;
        }

        .list-style-one li {
            color: var(--text-color);
            font-size: var(--font-22);
            font-weight: 400;
            line-height: 1.6em;
            margin-bottom: var(--margin-bottom-20);
            padding-left: var(--padding-left-50);
            position: relative;
        }

        .list-style-one li a {
            position: relative;
            transition: all 0.3s ease 0s;
        }

        .list-style-one li a, .list-style-one li a:hover {
            color: var(--main-color);
        }

        .list-style-one li .icon {
            color: var(--color-two);
            font-family: flaticon;
            font-size: var(--font-26);
            left: 0px;
            line-height: 1em;
            position: absolute;
            top: 5px;
            transition: all 0.3s ease 0s;
        }

        .list-style-one.style-two li {
            padding-left: var(--padding-left-35);
        }

        .list-style-one.style-two li .icon {
            font-size: var(--font-20);
        }

        .list-style-one.style-two li {
            font-size: var(--font-16);
        }

        .list-style-one.style-three li .icon {
            color: var(--main-color);
            font-size: var(--font-20);
        }

        .btn-style-one, .list-style-one.style-three li {
            font-size: var(--font-16);
        }

        .btn-style-one {
            background-color: var(--main-color);
            border-radius: 4px;
            color: var(--white-color);
            display: inline-grid;
            font-weight: 600;
            line-height: 30px;
            overflow: hidden;
            padding: 15px 38px;
