        @supports (color: rgb(0 0 0/0)) {
            :root {
                --color-ten: #cfd2d5
            }
        }

        * {
            border: none;
            margin: 0;
            outline: 0;
            padding: 0
        }

        body {
            -moz-font-smoothing: antialiased;
            color: var(--text-color);
            font-family: var(--font-family-Poppins);
            font-size: 14px;
            font-weight: 400;
            line-height: 1.6em
        }

        .bordered-layout .page-wrapper {
            padding: 0 50px
        }

        a {
            color: var(--main-color);
            cursor: pointer;
            position: relative;
            text-decoration: none;
            transition: all .3s ease
        }

        a:focus, a:hover, a:visited, button {
            outline: 0 !important;
            text-decoration: none
        }

        h1, h2, h3, h4, h5, h6 {
            background: 0 0;
            color: var(--white-color);
            margin: 0;
            position: relative
        }

        .transition-300ms {
            transition: all .3s ease;
            -moz-transition: all .3s ease;
            -webkit-transition: all .3s ease;
            -ms-transition: all .3s ease;
            -o-transition: all .3s ease
        }

        .transition-500ms {
            transition: all .5s ease;
            -moz-transition: all .5s ease;
            -webkit-transition: all .5s ease;
            -ms-transition: all .5s ease;
            -o-transition: all .5s ease
        }

        .transition-900ms {
            transition: all .9s ease;
            -moz-transition: all .9s ease;
            -webkit-transition: all .9s ease;
            -ms-transition: all .9s ease;
            -o-transition: all .9s ease
        }

        textarea {
            overflow: hidden
        }

        .text, p {
            color: var(--text-color);
            font-size: var(--font-16);
            line-height: 1.8em;
            opacity: .7;
            position: relative
        }

        h1 {
            font-size: var(--font-70);
            line-height: 1em
        }

        h1, h2 {
            font-weight: 600
        }

        h2 {
            font-size: var(--font-45);
            line-height: 1.2em
        }

        h3 {
            font-size: var(--font-30);
            line-height: 1.3em
        }

        h3, h4 {
            font-weight: 700
        }

        h4 {
            font-size: var(--font-24)
        }

        h4, h5 {
            line-height: 1.4em
        }

        h5 {
            font-size: var(--font-20)
        }

        h5, h6 {
            font-weight: 600
        }

        h6 {
            font-size: var(--font-18);
            line-height: 1.6em
        }

        .auto-container {
            max-width: 1240px
        }

        .auto-container, .medium-container {
            margin: 0 auto;
            padding: 0 15px;
            position: static
        }

        .medium-container {
            max-width: 1000px
        }

        .page-wrapper {
            margin: 0 auto;
            min-width: 300px;
            position: relative;
            width: 100%
        }

        li, ul {
            list-style: none;
            margin: 0;
            padding: 0
        }

        .theme-btn {
            cursor: pointer;
            display: inline-block;
            transition: all .3s ease;
            -moz-transition: all .3s ease;
            -webkit-transition: all .3s ease;
            -ms-transition: all .3s ease;
            -o-transition: all .3s ease
        }

        .centered {
            text-align: center
        }

        ::-webkit-input-placeholder {
            color: inherit
        }

        ::-moz-input-placeholder {
            color: inherit
        }

        ::-ms-input-placeholder {
            color: inherit
        }

        .scroll-to-top {
            background: var(--white-color);
            border-radius: 50%;
            bottom: 15px;
            box-shadow: 0 0 10px #00000026;
            color: var(--main-color);
            cursor: pointer;
            display: none;
            font-size: var(--font-16);
            height: 40px;
            line-height: 38px;
            position: fixed;
            right: 15px;
            text-align: center;
            text-transform: uppercase;
            transition: all .3s ease;
            width: 40px;
